import styled from 'styled-components';

export const HeaderContainer = styled.input`
  height: 48px;
  width: 360px;
  top: 64px;
  left: 120px;
  display: flex;
  justify-content: space-between;
  margin-bottom: 25px;
  border: 1px solid #DDDDDD;
  box-sizing: border-box;
  border-radius: 4px;

  font-family: Open Sans;
  font-style: normal;
  font-weight: normal;
  font-size: 16px;
  line-height: 24px;
`

